# Un local de ventas de café cambio su sistema y comenzó a operar con uno nuevo, en el cual se detectó 
# luego de venderle a 8 clientes que los precios estaban mal configurados, por lo cual hubo un cobro incorrecto. 
# Al final del día se le informa al dueño del local del error y solicitó conocer cuales habían sido esas 8 ventas. 
# Al ir a buscar esas ventas se dieron cuenta que se les habían desordenado los tickets, por lo cual obtener esos primero 8 no era tan simple,
# por lo tanto se solicita que se diseñe un algoritmo que obtenga las ventas con error, suponiendo que conoce la información de las mismas con horario de emisión.
# Como solicitud adicional se quiere un algoritmo que su complejidad en promedio sea mejor que O(n log n).